import React from "react";

import StyleView from "./StyleView/index";

const BuyStyle = ( props ) =>{

    const { flagShow, cartImg} = props

    return(
        <>
        {
            flagShow ? <StyleView cartImg/> :''
        }
        </>
      )
}

export default BuyStyle
